import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Go to the user profile page by clicking "Your Profile" link
    // Use text selector for "Your Profile" (first occurrence)
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });
    await profileLink.click();

    // Wait for the profile page to load (look for .profile-header)
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    // Full name
    const fullName = await page.$eval('.profile-header .profile-info h2', el => el.textContent.trim());
    // Username
    const username = await page.$eval('.profile-header .profile-info .username', el => el.textContent.replace(/^@/, '').trim());
    // Bio
    const bio = await page.$eval('.profile-header .profile-info .bio', el => el.textContent.trim());
    // Profile image
    const profileImage = await page.$eval('.profile-header .profile-image', el => el.getAttribute('src'));
    // Stats
    const stats = await page.$$eval('.profile-header .profile-stats .stat', nodes => nodes.map(stat => ({
      number: stat.querySelector('.stat-number')?.textContent.trim(),
      label: stat.querySelector('.stat-label')?.textContent.trim()
    })));
    // Map stats to keys
    let totalOrders = null, totalReviews = null, sellerRating = null;
    for (const stat of stats) {
      if (/orders?/i.test(stat.label)) totalOrders = stat.number;
      else if (/reviews?/i.test(stat.label)) totalReviews = stat.number;
      else if (/seller rating/i.test(stat.label)) sellerRating = stat.number;
    }

    // Extract Jun's recent reviews (titles and ratings)
    const reviews = await page.$$eval('.reviews-list .review-item', nodes =>
      nodes.map(node => ({
        productTitle: node.querySelector('.review-product-title')?.textContent.trim(),
        reviewTitle: node.querySelector('.review-title')?.textContent.replace(/"/g, '').trim(),
        rating: node.querySelector('.stars')?.textContent.trim(),
        content: node.querySelector('.review-content')?.textContent.trim(),
        date: node.querySelector('.review-date')?.textContent.trim()
      }))
    );

    // Extract Jun's products (titles)
    const products = await page.$$eval('.profile-sections .section:first-child .products-grid .product-card .product-title', nodes =>
      nodes.map(el => el.textContent.trim())
    );

    // Take screenshot of Jun's reviews section
    const reviewsSection = await page.$('.profile-sections .section:nth-child(2)');
    if (reviewsSection) {
      await reviewsSection.screenshot({ path: path.join(screenshotsDir, 'step_3_jun_reviews.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_jun_reviews.png'));
    }

    // Take screenshot of Jun's products section
    const productsSection = await page.$('.profile-sections .section:first-child');
    if (productsSection) {
      await productsSection.screenshot({ path: path.join(screenshotsDir, 'step_4_jun_products.png') });
      screenshots.push(path.join(screenshotsDir, 'step_4_jun_products.png'));
    }

    return {
      success: true,
      action: "Harvested user profile information from the profile page including name, username, bio, stats, products, and reviews.",
      extractedData: {
        fullName,
        username,
        bio,
        profileImage,
        totalOrders,
        totalReviews,
        sellerRating,
        products,
        reviews
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
